// src/components/CarTable.js
import React from 'react';

const CarTable = ({ vehicles }) => {
  const columns = [
    "Tipo de Auto",
    "Tipo de Combustible",
    "Marca",
    "Modelo",
    "Año",
    "Tipo de Transmisión",
    "Consumo en Ciudad",
    "Consumo en Carretera",
    "Consumo Mixto"
  ];

  return (
    <table>
      <thead>
        <tr>
          {columns.map((column, index) => (
            <th key={index}>{column}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {vehicles.map((vehicle, index) => (
          <tr key={index}>
            <td data-label="Tipo de Auto">{vehicle.tipoDeAuto}</td>
            <td data-label="Tipo de Combustible">{vehicle.tipoDeCombustible}</td>
            <td data-label="Marca">{vehicle.marca}</td>
            <td data-label="Modelo">{vehicle.modelo}</td>
            <td data-label="Año">{vehicle.año}</td>
            <td data-label="Tipo de Transmisión">{vehicle.tipoDeTransmision}</td>
            <td data-label="Consumo en Ciudad">{vehicle.consumoCiudad}</td>
            <td data-label="Consumo en Carretera">{vehicle.consumoCarretera}</td>
            <td data-label="Consumo Mixto">{vehicle.consumoMixto}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default CarTable;
